import styled from 'styled-components'

export const ContainerMoviePrincipal = styled.div`
display: grid;
grid-template-columns: 1f 1f 1f 1fr;
`

export const ContainerMovie = styled.div`
margin: 10px;
overflow-x: hidden;
grid-template-columns: 1f 1f 1f 1fr;


img {
    width: 150px;
}
`

